INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (1,'2024-10-06 07:46:52',6,74,624.05,3,'Me de virtute misisti. Sed ex eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu.','Esse numquam potest. Praeterea bona praeterita non meminerunt, praesentibus non fruuntur, futura modo expectant, quae quia certa esse non possunt et, si essent vera, nihil afferrent, quo iucundius, id est in voluptate. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Sed ad rem redeamus; de hominibus dici non necesse est. Tribus.','Sine cura metuque vivamus animumque et corpus, quantum efficere possimus, molestia liberemus. Ut enim aeque doleamus animo, cum corpore dolemus, fieri tamen permagna accessio potest, si aliquod aeternum et infinitum impendere malum nobis opinemur. Quod idem licet transferre in voluptatem, ut postea variari voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e patre.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (2,'2024-10-11 12:12:03',6,98,418.37,1,'Praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta.','Disciplinam probant, non soleat accuratius explicari; verum.','Re mihi non aeque satisfacit, et quidem tibi et declinationem istam atomorum et magnitudinem solis probabo et Democriti errata ab Epicuro sapiens semper beatus inducitur: finitas.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (3,'2024-09-23 03:45:51',1,21,577.66,5,'Inmortalibus supplicii causa importari putant. Quae autem inanes.','Vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus.','Ita paratus est, ut necessariae nec opera multa nec impensa expleantur; ne naturales quidem multa desiderant, propterea quod ipsa natura, ut ait ille, sciscat et probet, id est vel summum bonorum vel ultimum vel extremum -- quod et acutum genus est et ad usus.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (4,'2024-07-02 13:50:14',36,31,579.45,4,'Sin, ut dolore suo sanciret militaris imperii disciplinam exercitumque in gravissimo bello animadversionis metu contineret.','Dicturam pater aiebat, si loqui posset. Conclusum est enim contra Cyrenaicos satis acute, nihil ad.','Tria vix amicorum paria reperiuntur, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem angusta, quam magnos quantaque amoris conspiratione consentientis tenuit amicorum greges! Quod fit etiam nunc ab Epicureis. Sed ad rem redeamus; de hominibus dici non necesse est. Tribus igitur modis video esse.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (5,'2023-12-26 23:00:06',19,44,402.63,5,'Cum idem fabellas Latinas ad verbum e Graecis expressas non inviti legant. Quis enim tam inimicus paene nomini.','Placet: constituam, quid et quale sit id, de quo quaerimus, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum in sensibus ponit, quibus si semel aliquid falsi pro vero probatum sit, sublatum esse omne iudicium veri.','Qua intellegebat contineri suam. Atque haec ratio late patet. In quo enim maxime consuevit iactare vestra se oratio, tua praesertim, qui studiose antiqua persequeris, claris et fortibus viris commemorandis eorumque factis non emolumento aliquo, sed ipsius.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (6,'2024-02-26 23:08:38',40,91,602.60,2,'Cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo inventore veritatis et quasi involuta aperiri, altera prompta et aperta iudicari. Etenim quoniam detractis de homine sensibus reliqui nihil est, necesse est, non satis politus iis artibus, quas qui tenent, eruditi appellantur -- aut ne deterruisset alios a studiis. Quamquam te quidem video minime esse deterritum. Quae.','Audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amatoriis levitatibus dediti, alii petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob causas in eorum vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus.','Nihil asperum nisi dolorem, de quibus et ab Epicuro scriptum est et ab antiquis, ad arbitrium suum scribere? Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, quod nullam eruditionem esse duxit, nisi quae beatae vitae disciplinam iuvaret. An ille.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (7,'2024-05-14 08:17:32',20,6,377.84,4,'Quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter dolorem et voluptatem.','Nisi voluptatem, nihil asperum nisi dolorem, de quibus ante dictum est, sic.','Malit quam deserere ullam officii partem, ad ea, quae dices.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (8,'2024-07-25 10:36:54',6,47,572.11,3,'Nollem me ab eo nos abducat? Sin laboramus, quis est, qui dolorem eum fugiat, quo voluptas nulla pariatur? At vero eos et accusamus et iusto odio dignissimos ducimus, qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores et quas molestias excepturi sint, obcaecati cupiditate non provident, similique sunt in eadem causa sunt, qua ante quam nati.','Ad Epicurum. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est cur verear, ne ad eam non possim accommodare Torquatos nostros? Quos tu paulo ante collegi, abest.','Universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant nec tantum in alios caeco impetu incurrunt.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (9,'2024-11-11 14:59:33',18,25,580.34,4,'Atque integre iudicante. Itaque negat opus.','Historiae cognitioque rerum, quid poetarum evolutio, quid tanta tot versuum memoria voluptatis affert? Nec mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et.','Et accurate disserendum et rationibus conquisitis de voluptate et dolore magnam aliquam quaerat voluptatem. Ut enim aeque doleamus animo, cum corpore.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (10,'2024-04-13 14:00:28',14,65,476.93,5,'Cupiditatum generibusque earum explicatis, et, ut modo docui, cognitionis regula et.','Fortitudo quidem, sed ista sequimur, ut sine cura metuque vivamus.','Desiderabile concupiscunt, plusque in ipsa iniuria detrimenti est quam in iis rebus emolumenti, quae pariuntur iniuria. Itaque ne iustitiam quidem recte quis dixerit per se laetitiam, id est voluptatem. Homines.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (11,'2024-04-22 00:27:23',30,20,533.27,5,'Stultorum vitam cum sua comparat, magna afficitur voluptate. Dolores autem si qui e nostris aliter existimant, quos quidem video esse.','Et rerum gerendarum. Sic e physicis et fortitudo.','Etiam legum iudiciorumque poenis obligantur. Qui autem ita frui volunt voluptatibus, ut nulli propter eas consequantur dolores, et qui suum iudicium retinent, ne voluptate victi faciant id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia referenda, quid.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (12,'2024-01-16 06:38:10',25,36,449.40,4,'Vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam.','Placeat, facere possimus, omnis voluptas assumenda est, omnis dolor repellendus.','Dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae hoc non minus declarant, sed videntur leviora, veniamus. Quid tibi, Torquate.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (13,'2024-01-08 07:40:01',28,26,534.07,4,'Disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe, inquam.','Cum in rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum, quae naturales essent nec tamen id, cuius causa haec finxerat, assecutus est. Nam si omnes veri erunt, ut Epicuri ratio docet, tum denique poterit aliquid cognosci et.','Quaeque cernantur, omnia, eumque motum atomorum nullo a principio, sed ex aeterno tempore intellegi convenire. Epicurus autem, in quibus nulla solida utilitas omnisque puerilis.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (14,'2024-01-14 19:04:25',1,38,541.74,2,'Sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos ad iustitiam, aequitatem, fidem.','Perfruique maximis et animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore et ad tranquillitatem ferant, quid est enim in.','Aristoteli, Theophrasti orationis ornamenta neglexerit. Nam illud quidem physici.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (15,'2024-06-11 00:37:32',10,75,378.05,2,'Morbi sunt cupiditates inmensae et inanes.','Centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis.','Tamen et dignitatis esse negent. Contra quos omnis dicendum breviter.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (16,'2023-12-25 18:12:34',5,6,506.70,4,'Quadam placet ac leniat. Temperantia est enim, quae in rebus aut.','Quam deserere ullam officii partem, ad ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare.','Sine causa? Quae fuerit causa, mox videro; interea hoc.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (17,'2024-02-13 14:01:00',6,77,529.60,5,'Aegritudine possit et sine metu degendae praesidia firmissima. -- Filium morte multavit.','Oratio nostra omnem sibi fidem sensibus confirmat, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque.','Nobis probaretur, sed etiam spe eriguntur consequentis ac posteri temporis. Quod quia nullo modo sine amicitia firmam et perpetuam iucunditatem vitae tenere possumus neque vero ipsam amicitiam tueri.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (18,'2024-08-05 02:03:22',38,86,579.14,1,'Sed in his rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem morbi sunt cupiditates inmensae et inanes divitiarum, gloriae, dominationis, libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos conficiuntque curis hominum non intellegentium nihil dolendum esse.','In sanguinem suum tam crudelis fuisse, nihil ut de utilitatibus, nihil ut de omni virtute sit dictum. Sed similia fere dici possunt. Ut enim aeque doleamus animo, cum corpore dolemus.','Tamen in quibusdam neque pecuniae modus est neque honoris neque imperii nec libidinum nec epularum nec reliquarum cupiditatum, quas nulla praeda umquam improbe parta minuit, sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos in viam placatae.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (19,'2024-04-25 17:47:13',25,30,607.76,2,'Ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque parte audita pronuntiaret eum non talem videri fuisse.','Inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo docet, non quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus igitur, quid sit extremum et ultimum bonorum, quod omnium philosophorum sententia tale debet esse, ut ad id autem res referuntur omnes, fatendum est summum esse bonum iucunde vivere. Id qui in.','Et moribus comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (20,'2024-11-27 04:40:13',23,54,381.01,5,'Vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos ego posse iudicare arbitrarer, plura suscepi veritus ne movere hominum studia viderer, retinere non posse. Qui autem, si maxime hoc placeat, moderatius tamen.','Dolore et molestia perfruique maximis et animi et corporis voluptatibus, videtisne quam nihil molestiae consequatur, vel illum, qui dolorem ipsum, quia dolor sit, amet, consectetur, adipisci velit, sed quia consequuntur magni dolores eos, qui ratione voluptatem sequi nesciunt, neque porro quisquam est, qui dolorem eum fugiat, quo voluptas.','Petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob causas in eorum vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (21,'2023-12-27 23:54:59',37,93,606.05,2,'P. Scaevolam M''.que Manilium, ab iisque M. Brutus dissentiet -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id autem res referuntur omnes, fatendum est summum esse bonum quicquam nisi nescio quam illam umbram, quod appellant honestum non tam id.','Inquit, sic agam, ut ipsi auctori huius disciplinae placet: constituam, quid et quale sit id, de quo Lucilius: ''ferreum scriptorem'', verum, opinor, scriptorem tamen.','Parentes, multi amicos, non nulli patriam, plerique autem se ipsos amentur. Etenim si delectamur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (22,'2024-02-16 17:57:46',5,26,490.10,5,'Depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in.','Quod Epicurum nostrum non tu quidem oderis, ut fere faciunt, qui ab eo nos abducat? Sin laboramus, quis est, qui Ennii Medeam aut Antiopam Pacuvii spernat aut reiciat, quod se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum.','Quo non plus voluptatum habeat quam dolorum. Nam et.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (23,'2024-04-26 20:23:54',31,89,556.51,2,'Sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Scaevolam M''.que Manilium, ab iisque vitiis, quae paulo ante collegi, abest plurimum et.','Erit affectus erga amicum, quo in se ipsum, quosque labores.','Nihil aliud sit nisi cum voluptate vivere. Nec enim.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (24,'2024-01-03 20:38:27',38,94,438.49,2,'Altera philosophiae parte. Quae est quaerendi ac disserendi, quae logikh dicitur, iste vester plane, ut mihi quidem videtur.','Coercendi magis quam dedocendi esse videantur.','Disputandum putant. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (25,'2024-09-10 22:46:17',35,13,483.99,3,'Utens nihil quieti videre, nihil tranquilli potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae nos exhorrescere.','Qua etiam carere possent sine dolore tum in dedecora incurrunt, saepe etiam legum iudiciorumque poenis obligantur. Qui autem ita frui volunt voluptatibus, ut nulli propter eas consequantur dolores, et qui.','Magis animi morbis impediri necesse est! Animi autem voluptates et dolores animi quam.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (26,'2024-06-10 05:49:34',28,68,559.45,5,'Exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et horrida, de malis Graecis Latine scripta deterius. Quibus ego assentior, dum modo de isdem rebus ne.','Cum ea non placeat, tamquam e theatro exeamus. Quibus rebus.','Et in conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis cogitavisse? Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Stulti autem malorum memoria torquentur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (27,'2024-01-31 05:28:03',22,28,452.43,3,'Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur.','Iis bonis erigimur, quae expectamus, sic laetamur iis, quae et splendide dicta sint neque sint conversa de Graecis? Nam si concederetur, etiamsi ad corpus nihil referatur.','Fuisse. Fieri, inquam, Triari, nullo pacto potest, ut non plus voluptatum habeat quam dolorum.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (28,'2024-03-18 20:27:10',40,42,385.77,5,'Inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de.','In reque eo meliore, quo maior sit.','Te ipsum probaturum esse confidam. Certe, inquam, pertinax non ero tibique, si mihi probabis ea, quae voluptaria, delicata, mollis habeatur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (29,'2023-12-03 14:07:57',4,11,623.24,3,'Magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos in viam placatae, tranquillae, quietae, beatae vitae disciplinam iuvaret.','Tractatos? Quid? Epicurei num desistunt de isdem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes bene sanos ad iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile efficere possit.','Ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si amicitiam propter nostram voluptatem expetendam putemus, tota amicitia quasi claudicare videatur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (30,'2024-02-21 10:32:39',9,57,506.81,3,'Aliquo, sed ipsius honestatis decore laudandis, id totum evertitur eo delectu rerum, quem modo dixi, constituto, ut aut.','Hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est corpora individua propter soliditatem, censet in infinito inani, in.','Mediocritatem desiderent. Sive enim ad minima veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in longinquitate levis, in gravitate brevis soleat esse, ut.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (31,'2024-02-23 12:24:47',25,94,497.75,5,'Contentam. Sed possunt haec quadam ratione dici non necesse est. Tribus igitur modis video.','Iis servire, qui vel utrisque litteris uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem.','Id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (32,'2024-01-20 22:46:38',10,36,515.00,2,'Imbutus quietus esse numquam potest. Praeterea bona praeterita grata recordatione renovata delectant. Est autem situm in nobis ut et adversa quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum.','Aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et corpore voluptatibus nullo dolore nec impediente nec inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est aut in.','Fugiendam inprobitatem putamus, sed multo magis vita et factis et moribus comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in quibus hoc primum est in voluptate. Neque enim disputari.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (33,'2024-06-26 08:39:22',36,63,558.22,5,'Ita prorsus existimo, neque eum Torquatum, qui hoc primus cognomen invenerit, aut torquem illum hosti detraxisse, ut aliquam ex eo perciperet corpore voluptatem, aut cum Latinis tertio consulatu.','Atomorum inter se, ex quo efficiantur ea, quae dixi, sole ipso illustriora et clariora sunt, si omnia dixi hausta e fonte naturae, si tota oratio nostra.','Gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (34,'2024-06-21 07:44:16',29,53,549.03,4,'Atque nostra et pariter dolemus angoribus. Quocirca eodem modo sapiens erit affectus erga amicum, quo in se ipsum, quosque labores.','Sequitur Democritum, non fere labitur. Quamquam utriusque cum multa non probo, tum illud in primis, quod, cum in rerum natura duo quaerenda sint, unum, quae materia sit.','Vis et natura orationis et consequentium repugnantiumve ratio potest perspici. Omnium autem rerum natura duo quaerenda sint, unum.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (35,'2024-11-26 02:18:44',14,45,376.19,1,'Labores magnosque susceperant. Ecce autem alii minuti et angusti aut omnia semper desperantes aut malivoli, invidi, difficiles, lucifugi, maledici, monstruosi, alii autem etiam amaret.','Quaedam nos natura genuit et conformavit, ut mihi quidem depravare videatur. Ille atomos quas appellat, id est vel summum bonorum vel ultimum vel extremum -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id autem.','Quoniam, cum privamur dolore, ipsa liberatione et vacuitate omnis molestiae gaudemus, omne autem id, quo gaudemus, voluptas est.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (36,'2024-10-25 05:10:19',12,55,503.96,4,'Doloribus, etiamsi voluptas ea, quae dices, libenter assentiar. Probabo, inquit.','Negant posse a voluptate discedere. Nam cum ignoratione rerum bonarum et malarum maxime hominum vita vexetur, ob eumque errorem et voluptatibus maximis saepe priventur et durissimis animi doloribus torqueantur, sapientia est adhibenda, quae et splendide dicta sint neque sint conversa de Graecis? Nam si dicent ab illis has res esse tractatas, ne.','Qui me ad alias litteras vocent, genus hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo libro, quo a populo.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (37,'2023-12-05 06:04:25',18,88,459.93,2,'Istae enim vestrae eximiae pulchraeque virtutes nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim virtutes, de quibus.','Idem licet transferre in voluptatem, ut postea variari voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e.','Involuta aperiri, altera prompta et aperta iudicari. Etenim quoniam detractis de homine sensibus reliqui.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (38,'2024-11-25 09:23:30',10,79,566.76,2,'Pervenias profectus a Theseo. At.','Inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est aut fastidii delicatissimi. Mihi quidem videtur. Ac fieri potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, si nihil efficeret; nunc.','Persequeretur, vivendi artem tantam tamque et operosam et perinde fructuosam relinqueret? Non ergo Epicurus ineruditus, sed ii indocti, qui, quae pueros non didicisse turpe.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (39,'2024-03-27 14:19:55',28,6,389.56,2,'Efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter.','Nemini e nostris, qui haec subtilius velint tradere.','Paratus est, ut meminerit maximos.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (40,'2024-04-08 21:29:39',3,60,597.64,1,'Tu quidem oderis, ut fere faciunt, qui ab eo dissentiunt, sed certe non probes, eum quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse, quae pertinerent ad bene beateque vivendo a Platone disputata sunt.','Homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe, inquam, pertinax non ero tibique, si mihi probabis ea, quae voluptaria, delicata, mollis habeatur disciplina, quam gravis, quam.','Discordia dominorum domus; quo minus omnes mea legant. Utinam esset ille Persius, Scipio vero et Rutilius multo etiam magis, quod, cuius in mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (41,'2024-05-10 22:03:38',3,46,460.95,5,'Quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum.','Turma omnis chorusque: ''chaere, Tite!'' hinc.','Error omnis imperitorum intellegaturque ea, quae voluptaria, delicata, mollis habeatur disciplina, quam gravis, quam continens, quam severa sit. Non enim hanc solam sequimur, quae suavitate aliqua naturam ipsam.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (42,'2024-03-26 23:30:48',13,49,443.46,1,'Et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi.','Etiam sapientia est; sive hoc difficile est, tamen nec modus est neque honoris neque imperii nec.','Quae cum dixisset, Explicavi, inquit, sententiam meam, et eo quidem consilio, tuum iudicium ut cognoscerem, quoniam mihi ea facultas, ut id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (43,'2024-03-01 02:03:01',15,56,456.27,5,'Elaboraret, et sunt illius scripta leviora.','Suum iudicium retinent, ne voluptate victi faciant id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia referenda, quid sequatur natura ut summum ex rebus expetendis, quid fugiat ut extremum malorum? Qua de re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis.','Utinam esset ille Persius, Scipio vero et Rutilius multo etiam magis, quod, cuius in animo versatur, numquam sinit eum respirare, numquam adquiescere. Quodsi ne.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (44,'2024-10-13 18:41:59',5,74,552.97,3,'Voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda.','Hostem impetum fecisse aut in voluptate esse aut in armatum hostem impetum fecisse aut in armatum hostem impetum fecisse aut in dolore, sed in his rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem voluptates et dolores animi quam corporis. Nam corpore nihil nisi praesens et quod quaeritur saepe, cur tam.','Et vita sine amicis insidiarum et metus et aegritudines ad dolorem referuntur, nec praeterea est res ulla, quae sua natura aut sollicitare possit aut angere. Praeterea et appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a dolore. Quod cum ita esset affecta, secundum non recte, si voluptas esset bonum, desideraret.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (45,'2024-02-08 07:58:25',26,53,447.40,3,'Nostro frequenter audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amatoriis levitatibus dediti, alii petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia.','Eiusmod tempor incididunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim medicorum scientiam non ipsius artis.','Amicitiae non modo singulos homines, sed universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant nec.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (46,'2024-04-23 12:28:01',20,63,507.58,4,'Cernimus, id omne oritur a sensibus; qui si omnes.','Quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur, inquit, sic agam, ut.','Voluptatis et liberae potest. Atqui pugnantibus et contrariis studiis consiliisque semper utens nihil quieti videre.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (47,'2023-12-10 06:55:36',28,81,556.42,3,'Iste vester plane, ut mihi quidem videtur, inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo docet, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum dirigentur, numquam ullius oratione victi sententia desistemus. Nisi autem rerum natura duo quaerenda sint, unum, quae materia sit, ex qua.','Omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu.','Suscipit, ut non plus habeat sapiens, quod gaudeat, quam quod angatur. Optime vero Epicurus, quod exiguam dixit fortunam intervenire sapienti maximasque ab eo delectari, quod ista Platonis, Aristoteli, Theophrasti orationis.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (48,'2024-05-14 17:14:19',18,35,595.04,2,'Ait enim declinare atomum sine causa; quo nihil posset.','Oculis quidem exercitus. -- Quid ex eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu vivere. Quae est enim in vita tantopere quaerendum quam cum omnia in philosophia, tum id.','Torquentur, sapientes bona praeterita grata recordatione renovata delectant. Est autem situm in nobis ut.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (49,'2024-06-27 08:00:37',25,3,624.27,3,'Individua et solida corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia dixi hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est voluptatem. Homines optimi non intellegunt totam rationem everti, si ita res se habeat. Nam si.','Fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum.','In voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare, Torquate. Oratio me istius philosophi non offendit; nam et ipsa.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (50,'2024-08-31 23:32:02',32,62,591.15,3,'Verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia transferrem. Sed id neque feci adhuc nec mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et erant illa.','Benivolentiam sibi conciliant et, quod aptissimum est ad quiete vivendum, caritatem, praesertim cum omnino nulla sit utilitas ex amicitia, tamen ipsi amici propter se.','Est, quae non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam vacare omni dolore careret, non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam vacare omni dolore et molestia perfruique.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (51,'2024-06-17 21:03:10',4,67,620.34,4,'Se dicant in Graecis legendis operam malle consumere. Postremo aliquos futuros suspicor, qui me ad alias litteras vocent, genus hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo.','Hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis servire, qui vel utrisque litteris uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem.','Corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes bene sanos in viam placatae, tranquillae, quietae, beatae vitae dicta.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (52,'2024-01-20 21:33:09',12,55,459.15,3,'Cupiditate non provident, similique sunt in eadem causa sunt, qua ante quam nati, et ad.','Quid malum, sensu iudicari, sed animo etiam ac ratione intellegi posse et voluptatem ipsam.','Gaudemus, omne autem id, quo gaudemus, voluptas est, ut omne, quo offendimur, dolor.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (53,'2023-12-08 22:56:03',37,72,618.58,4,'Comparandae voluptatis -- Quam autem ego dicam voluptatem, iam videtis, ne invidia verbi labefactetur oratio mea --. Nam cum ignoratione rerum bonarum et malarum maxime hominum vita vexetur, ob eumque errorem et voluptatibus maximis saepe priventur et durissimis animi doloribus torqueantur, sapientia.','Assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet, ut et adversa quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae sensum moveat, nulla successerit, eoque.','Deinde hoc quoque alienum; nam ante Aristippus, et ille melius. Addidisti ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (54,'2024-02-03 22:45:58',30,87,445.40,3,'Disserendum et rationibus conquisitis de voluptate et dolore magna aliqua. Ut enim ad minim veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquip ex.','Magis expetendum possimus dicere? Inesse enim necesse est effici, ut sapiens solum amputata circumcisaque inanitate omni et errore naturae finibus contentus.','Me istius philosophi non offendit; nam et praeterita.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (55,'2024-07-15 10:54:05',32,44,597.51,5,'Et negent satis esse, quid bonum sit aut quid iudicat, quo aut petat aut fugiat aliquid, praeter voluptatem et dolorem. Ad haec et quae vel aliter pararetur et.','Erant, ad quorum iudicium elaboraret, et sunt illius.','Et perpetuam iucunditatem vitae tenere possumus neque vero ipsam amicitiam tueri, nisi aeque amicos et.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (56,'2024-09-03 13:10:18',6,47,428.94,4,'Iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile.','Natura perspecta erit, nullo modo poterimus sensuum.','Et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Scaevolam M''.que.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (57,'2024-09-25 18:19:55',31,59,554.97,2,'Sed ut omittam pericula, labores, dolorem etiam, quem optimus quisque pro patria et pro suis.','Quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse.','Tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (58,'2024-06-02 12:45:56',3,24,408.25,1,'Haec, quae vitam omnem perturbari videmus errore et inscientia.','Perpessio dolorum per se ipsa allicit nec patientia nec assiduitas nec vigiliae nec ea ipsa, quae tibi probarentur; si qua.','Legum odioque civium? Et tamen in quibusdam neque pecuniae modus est ullus investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum id, quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si amicitiam propter nostram voluptatem expetendam putemus, tota.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (59,'2024-03-31 13:28:59',25,23,495.03,5,'In sensibus ponit, quibus si semel aliquid falsi pro vero probatum sit, sublatum esse omne iudicium veri et falsi putat. Confirmat autem illud vel maxime, quod ipsa natura, ut ait ille, sciscat et probet, id est voluptatem et dolorem.','Sapientia, quae ars vivendi putanda est, non expeteretur, si nihil efficeret; nunc expetitur, quod.','Perspiciatis, unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam eaque ipsa, quae laudatur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (60,'2024-06-11 02:57:40',29,41,428.78,5,'Contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa.','Doloribus eosque humili animo inbecilloque ferre miserum est, ob eamque debilitatem animi multi parentes, multi amicos, non nulli patriam, plerique autem se ipsos penitus perdiderunt, sic robustus animus.','Legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (61,'2024-04-24 07:28:29',24,62,547.53,2,'In primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me de.','Maximi cadere possunt, nulla spe proposita fore levius aliquando, nulla praeterea neque praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda est, summum profecto malum est vivere cum dolore, cui sententiae consentaneum.','Disserunt. Praeterea sublata cognitione et scientia.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (62,'2024-07-12 16:23:31',3,46,593.28,2,'Quidem locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem tandem, inquit, non satisfacit? Te enim iudicem aequum puto, modo quae dicat ille bene noris. Nisi mihi Phaedrum, inquam, tu mentitum aut Zenonem putas, quorum utrumque audivi, cum miraretur ille.','Ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat. Hanc ego cum teneam sententiam, quid est cur dubitemus dicere et sapientiam.','Est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (63,'2024-02-26 15:17:33',30,24,555.74,5,'Voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas.','Minus id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia.','Aut perferendis doloribus asperiores repellat. Hanc ego cum teneam sententiam, quid est cur tam multi sint Epicurei, sunt aliae quoque.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (64,'2024-02-06 13:16:55',3,36,613.85,1,'Diligant. Quod et scripta multa sunt, sic inprobitas si cuius in mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis occulte fecerit, numquam.','Magnitudinem celeritas, diuturnitatem allevatio consoletur. Ad ea cum accedit, ut neque divinum numen horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, cur nostri a nostris non legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad.','Sit causa peccandi. Quae enim cupiditates a natura proficiscuntur, facile explentur sine ulla iniuria, quae autem de bene beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur munere, sed tuemur ea, quae dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (65,'2024-04-14 13:19:47',28,49,465.78,3,'Graeco sermone tractavissent, ea Latinis litteris mandaremus, fore ut hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis.','Facilius id, quod propositum est, summum bonum consequamur? Clamat Epicurus, is quem vos nimis voluptatibus esse deditum dicitis; non posse iucunde vivi, nisi sapienter, honeste iusteque vivatur, nec sapienter, honeste, iuste, nisi iucunde. Neque enim civitas in seditione beata.','Fugienda est, summum profecto malum est vivere cum dolore, cui sententiae.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (66,'2024-09-26 14:04:20',26,48,515.26,5,'Quae sua natura aut sollicitare possit aut angere. Praeterea et appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate discedere. Nam.','Qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores.','Autem explicabo, voluptas ipsa quae.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (67,'2024-05-22 06:17:43',12,75,393.78,1,'Officii partem, ad ea, quae dixi, sole ipso illustriora et clariora sunt, si omnia dixi hausta e fonte naturae, si.','De re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium.','Malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam e nostris, qui haec subtilius velint tradere et negent.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (68,'2024-02-15 04:25:14',25,65,433.75,5,'Ut id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem.','Disputationi interesset. Nam cum ad me de virtute misisti. Sed ex eo credo quibusdam usu venire; ut abhorreant a Latinis, quod inciderint in inculta quaedam et horrida, de malis Graecis Latine scripta deterius. Quibus ego assentior.','In gravitate brevis soleat esse, ut ad Orestem pervenias.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (69,'2024-09-01 05:53:09',4,100,455.86,2,'Eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, a meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me in Cumanum salutandi causa.','Scientiam non ipsius artis, sed bonae valetudinis causa probamus, et gubernatoris ars, quia.','De physicis alias, et quidem locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem tandem, inquit, non satisfacit? Te enim.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (70,'2024-06-18 05:27:05',3,40,482.72,2,'Voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim aeque doleamus.','Idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque.','Et vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos modo nominavi, cum inciderit, ut id meo arbitratu facerem, ante hoc tempus numquam est neque perpessio dolorum per se ipsam causam non.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (71,'2024-07-08 03:41:30',29,36,580.12,5,'Poenis obligantur. Qui autem alia malunt scribi a nobis, aequi esse debent, quod et acutum genus est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus id, quod quaeritur, sit pulcherrimum. Etenim.','Eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad sapientiam perveniri potest, non paranda nobis solum ea, sed fruenda etiam sapientia est; sive hoc difficile est, tamen nec modus ullus nec finis inveniri potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam.','Voluptatem. Quisquis enim sentit, quem ad modum, quaeso, interpretaris? Sicine eos censes aut in dolore. Omnis autem privatione doloris putat Epicurus terminari.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (72,'2024-02-29 16:47:11',15,36,470.13,4,'Meo doctiores cives mei, nec cum.','Electram, tamen male conversam Atilii mihi legendam putem, de quo Lucilius: ''ferreum.','Liber cum et tibi probatus videretur et iis, quos modo nominavi, cum Attico nostro frequenter audivi.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (73,'2024-01-17 18:38:07',22,79,527.47,4,'Esset et virtus et cognitio rerum, quod minime ille vult expetenda. Haec igitur Epicuri non probo, tum illud in primis, quod, cum in rerum natura cognita levamur superstitione, liberamur mortis metu, non conturbamur ignoratione rerum, e qua ipsa horribiles existunt.','Et dicit plane, quod intellegam; et tamen ego.','A falso distinctio traditur. Restat locus huic disputationi vel.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (74,'2024-06-15 06:18:51',1,72,411.62,5,'Expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus id, quod maxime placeat, facere possimus.','Effici, ut sapiens solum amputata circumcisaque inanitate omni.','Illae Epicuri propriae ruinae: censet enim eadem illa constituto veri a falso distinctio traditur. Restat locus huic disputationi vel maxime necessarius de amicitia, quam.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (75,'2024-04-28 23:15:10',35,78,596.24,2,'Comprobavit. Quod quam magnum sit.','Ducimus, qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores et quas molestias excepturi sint, obcaecati cupiditate non provident, similique.','Habeo quae velim. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de una.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (76,'2024-07-30 06:02:55',3,47,413.52,4,'Ipsas tam expetendas, quam nostras expeteremus, quo loco videtur quibusdam stabilitas amicitiae vacillare, tuentur tamen eum locum seque.','Quod huc possit, quod melius sit, accedere?','Maxime necessarius de amicitia, quam, si voluptas esset bonum, desideraret.'' -- Ita credo. -- ''Non est igitur voluptas bonum.'' Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Conclusum est enim in vita tantopere quaerendum quam cum omnia in philosophia, tum id, quod his libris quaeritur, qui.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (77,'2024-09-30 21:23:44',10,36,578.89,3,'Verum etiam summam voluptatem. Quisquis enim sentit, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam.','E corpore et ad dolores ita paratus est, ut omne, quo offendimur, dolor.','Qui, quae pueros non didicisse turpe est, ea putant usque ad senectutem esse discenda. Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (78,'2023-12-26 21:04:24',24,21,574.02,5,'Sentiri haec putat, ut calere ignem, nivem esse albam, dulce mel. Quorum nihil oportere exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam.','Etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit. Ne illud quidem perspicuum est, maximam animi aut voluptatem aut molestiam plus aut ad beatam aut ad beatam aut ad miseram vitam afferre momenti quam eorum utrumvis, si aeque diu sit in corpore.','Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Quid? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (79,'2024-07-18 21:36:13',28,97,377.02,3,'In philosophia, tum id, quod maxime placeat, facere possimus, omnis voluptas assumenda est, omnis dolor.','Istae enim vestrae eximiae pulchraeque virtutes nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim virtutes, de quibus ante dictum est, sic amicitiam negant posse a voluptate.','Et alliciat suapte natura, non potest esse dubium, quin id sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate conectitur. Nam et ipsa declinatio ad libidinem fingitur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (80,'2024-07-15 14:02:12',22,9,378.96,4,'Quo maior sit, mediocritatem desiderent. Sive enim ad sapientiam perveniri potest, non.','Ipsam optabilem, sed quia non numquam eius modi esse iudico, ut nihil homine videatur indignius. Ad maiora enim quaedam nos natura genuit et conformavit, ut mihi videtur, expediunt. Ut enim.','Est ultimum esse bonorum voluptatem ex infinito tempore aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (81,'2024-07-18 18:43:05',28,93,518.57,1,'Quid? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut.','Isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est non miser. Accedit etiam mors, quae quasi delapsa.','Attingere itaque ** attulit rem commenticiam: declinare dixit atomum perpaulum, quo nihil turpius physico, quam fieri quicquam sine causa dicere, -- et illum motum naturalem omnium ponderum, ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Quid ei reliquisti, nisi.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (82,'2024-01-08 19:29:18',35,10,593.46,1,'L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, a meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me accedis.','Flagitem. Re mihi non aeque satisfacit, et quidem tibi et declinationem istam atomorum et magnitudinem solis probabo et Democriti errata ab Epicuro reprehensa et correcta permulta. Nunc dicam.','Vivendum aptior partitio quam illa, qua est usus Epicurus? Qui unum genus posuit earum cupiditatum, quae essent et naturales et necessariae, alterum, quae vis.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (83,'2024-01-22 21:04:02',11,27,389.88,3,'Illaberetur, nec manus esse contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est.','Est. Extremum autem esse bonorum eum voluptate vivere. Huic certae stabilique sententiae.','Etiam oportet in eo, qui ita sit affectus, eum necesse est in voluptate aut.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (84,'2023-12-22 15:40:50',9,10,550.74,4,'Defenditur, tamen eius modi tempora incidunt, ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquip ex ea commodi consequatur? Quis autem vel eum iure reprehenderit, qui in ea voluptate velit esse, quam.','Philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, si nihil tale metuamus. Iam illud quidem physici, credere aliquid esse minimum, quod profecto numquam putavisset, si a Polyaeno, familiari suo, geometrica discere maluisset quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis.','Bonum esse vult, summumque malum dolorem, idque instituit docere sic: Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem aspernari ut summum malum et, quantum possit, a se.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (85,'2024-07-11 05:00:27',3,92,399.67,4,'Posset. Conclusum est enim in vita tantopere quaerendum quam cum omnia in philosophia.','Est in Ceramico Chrysippi sedentis porrecta.','Vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est, ut Epicuro placet, nihil.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (86,'2024-09-21 03:00:22',23,20,406.04,2,'Vidit, deinde hoc quoque alienum; nam ante.','Ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque parte audita pronuntiaret eum non talem videri fuisse in imperio, quales eius maiores fuissent, et in.','Quidam e nostris, et scribentur fortasse plura, si.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (87,'2024-10-17 01:41:23',12,79,428.68,1,'Conetur, nec optinere, si effecerit, et opes vel fortunae vel ingenii liberalitati magis conveniunt, qua qui est imbutus.','Id in voluptate ponatur, sed sine hoc institutionem omnino amicitiae non posse iucunde.','Nam ut Terentianus Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (88,'2024-03-19 02:10:12',15,99,608.57,2,'Aperiam eaque ipsa, quae laudatur, industria, ne fortitudo quidem, sed ista sequimur, ut sine cura metuque vivamus animumque et corpus, quantum efficere possimus, molestia liberemus. Ut enim mortis metu omnis quietae vitae status perturbatur, et ut succumbere doloribus eosque humili animo inbecilloque ferre miserum.','Fugiat aliquid, praeter voluptatem et parvam et non necessariam et quae sequamur et quae sequamur et quae vel aliter pararetur et qua etiam carere possent sine dolore tum in morbos gravis, tum in morbos gravis, tum.','Antiquis, ad arbitrium suum scribere? Quodsi Graeci leguntur a Graecis isdem de.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (89,'2024-10-06 16:54:44',36,3,558.25,4,'Regione inferiorem locum petentium sine causa dicere, -- et illum motum naturalem omnium ponderum, ut ipse constituit, e regione inferiorem locum petentium sine causa dicere, -- et.','Nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim mortis metu omnis quietae vitae status perturbatur, et.','Ne id ipsum quidem expedire possunt.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (90,'2024-08-09 19:54:56',14,10,397.75,3,'Quidem ita dicit, omnium rerum, quas ad beate vivendum se ipsa esse contentam. Sed possunt haec quadam ratione dici non modo.','Penitus perdiderunt, sic robustus animus.','Docui cum voluptate, ut ab ea nullo modo probantur, tamen Democritum laudatum a ceteris ab hoc, qui eum unum secutus esset, nollem vituperatum. Iam in altera philosophiae parte. Quae est quaerendi ac disserendi, quae logikh dicitur.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (91,'2024-02-15 15:02:41',17,6,586.52,4,'Hoc commune vitium, illae Epicuri propriae ruinae: censet enim eadem illa individua et solida corpora ferri deorsum suo pondere ad lineam, numquam fore ut hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis servire.','Rebus instructus semper est in voluptate ponit, quod summum bonum in voluptate est. Extremum autem esse bonorum eum voluptate vivere. Huic certae stabilique sententiae quae sint quaeque cernantur, omnia, eumque motum atomorum nullo a principio, sed ex aeterno tempore intellegi convenire. Epicurus autem, in.','Instructior -- est enim, quod tibi parum videtur eruditus, ea causa est, quod huc possit, quod melius sit, accedere? Statue contra aliquem confectum tantis animi corporisque doloribus, quanti in hominem maximi cadere possunt, nulla spe proposita fore levius aliquando, nulla praeterea neque praesenti nec expectata voluptate, quid eo.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (92,'2024-11-15 13:33:57',4,90,375.80,2,'Dein sermo atque fama, tum accusator, tum iudex; Multi etiam, ut te consule, ipsi se indicaverunt. Quodsi qui satis sibi contra hominum conscientiam saepti esse et voluptates et dolores nasci fatemur e corporis voluptatibus et doloribus -- itaque concedo, quod.','Vide, quantum, inquam, fallare, Torquate. Oratio me istius philosophi non offendit; nam et praeterita et futura. Ut enim.','Ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque ea, quae dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur, inquit, sic.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (93,'2023-12-10 00:15:33',1,48,606.05,3,'Enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque ea, quae dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate.','Contineret, saluti prospexit civium, qua intellegebat contineri suam. Atque haec ratio late patet. In quo enim maxime consuevit iactare vestra se oratio, tua praesertim, qui studiose antiqua persequeris.','Et aperta iudicari. Etenim quoniam detractis de homine.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (94,'2024-01-17 10:34:14',9,74,404.08,2,'In sanguinem suum tam crudelis fuisse, nihil ut de omni virtute sit dictum. Sed similia fere dici possunt.','Eius, a quo dissentias. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Cum praesertim illa perdiscere ludus esset.','Et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et quasi architecto beatae vitae disciplinam iuvaret. An ille tempus aut in dolore. Omnis autem privatione doloris putat Epicurus terminari summam voluptatem, ut postea variari voluptas distinguique.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (95,'2024-09-12 05:30:56',3,22,480.44,3,'Inter nos de litteris, quarum summum erat in utroque studium, deinde Torquatus.','Quod videamus esse finitum. In dialectica autem vestra nullam.','Sum, debeo profecto, quantumcumque possum, in eo filio adhibuit, quem in adoptionem D. Silano emancipaverat, ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque parte.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (96,'2023-12-22 03:22:55',40,49,523.40,3,'Sit, aspernatur aut odit aut fugit, sed quia maiores consequatur. Eadem fortitudinis ratio reperietur. Nam neque laborum perfunctio neque perpessio dolorum per se ipsa esse contentam. Sed possunt haec quadam.','Lucifugi, maledici, monstruosi, alii autem etiam amaret, cotidieque inter nos de litteris, quarum summum erat in utroque studium, deinde Torquatus: Quoniam nacti te, inquit, sumus aliquando otiosum, certe audiam, quid.','Quo a nobis philosophia defensa et.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (97,'2024-01-09 04:18:27',32,66,538.79,4,'Etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut non modo quid nobis probaretur, sed etiam quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est. Quam a nobis sic.','Potest, nisi derigatur ad voluptatem, voluptas autem est sola, quae nos exhorrescere metu non sinat. Qua praeceptrice in tranquillitate vivi potest omnium cupiditatum ardore restincto. Cupiditates enim.','Homines, tot sententiae; falli igitur possumus. Quam ob rem tandem, inquit, non satisfacit? Te enim iudicem.');
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (98,'2024-01-17 00:32:49',12,6,495.79,5,'Posteri temporis. Quod quia nullo modo probantur, tamen Democritum laudatum a ceteris ab hoc, qui eum unum secutus esset, nollem vituperatum. Iam in altera philosophiae parte. Quae est quaerendi ac disserendi, quae logikh dicitur, iste vester plane, ut mihi quidem depravare videatur. Ille atomos.','Est, ob eamque causam propter voluptatem et.','Ad rem redeamus; de hominibus dici non.');
