INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES (100,'2024-06-06 05:38:44',3,49,497.67,4,'Eumque motum atomorum nullo a principio, sed.','Bonum, fuisse desideraturam. Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Extremum autem esse bonorum voluptatem ex infinito tempore aetatis percipi posse, quam ex.','''Utinam ne in nemore . . .'' nihilo minus legimus quam hoc idem Graecum, quae autem de bene beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur munere.');
